import styled from "styled-components";
import { Link } from "../link/Link";

type MenuType = {
	menuItems: Array<string>;
};

export function Menu(props: MenuType) {
	return (
		<StyledMenu>
			<ul>
				{props.menuItems.map((el) => (
					<ListItem>
						<Link href="">{el}</Link>
					</ListItem>
				))}
			</ul>
		</StyledMenu>
	);
}

const StyledMenu = styled.nav`
	ul {
		display: flex;
		gap: 20px;
		list-style: none;
	}
`;
